import React from 'react';
import './sidebar.css';
import Logo from '../../assets/logo.svg';

const Sidebar = () => {
  return (
    <aside className='aside'>
      <a href='#home' className='nav_logo'>
        <img src={Logo} alt='' />
      </a>
    </aside>
  )
}

export default Sidebar
